import React from 'react';

const Header = ({ onLoginClick, onRegisterClick }) => {
  return (
    <header>
      <h1>Магазин</h1>
      <nav>
        <button onClick={onLoginClick}>Войти</button>
        <button onClick={onRegisterClick}>Регистрация</button>
      </nav>
    </header>
  );
};

export default Header;
